import "./App.css";
import Tasks from "./components/Tasks";
import CompletedTasks from "./components/CompletedTasks";

function App() {
  return (
    <div className="App">
      <header>
        <h1>TaskZ</h1>
        <p>A task manager built using react.js</p>
      </header>
      <main>
        <Tasks></Tasks>
      </main>
    </div>
  );
}

export default App;
